import React from "react";
import { makeStyles } from "@material-ui/styles";

function App() {
  const useStyles = makeStyles({
    wrap: {
      width: 100,
      height: 100,
      backgroundColor: "pink"
    },
    font: {
      fontSize: 12,
      fontWeight: 500
    }
  });

  const classes = useStyles();
  return (
    <div>
      <div className={classes.wrap}>
        <span> 222</span>
      </div>
    </div>
  );
}

export default App;
